  AzureNamedKeyCredential,
  NamedKeyCredential,
  isNamedKeyCredential
} from "./azureNamedKeyCredential";
export { AzureSASCredential, SASCredential, isSASCredential } from "./azureSASCredential";

export {
  TokenCredential,
  GetTokenOptions,
  AccessToken,
  isTokenCredential
} from "./tokenCredential";

